import React from 'react';
import { Field, ErrorMessage } from 'formik';


const Step2 = ({ prevStep, nextStep }) => {
    return (
        <div>
            <h2>Step 2: Additional Information</h2>
            <div>
                <label htmlFor="question1">Question 1:</label>
                <Field type="text" name="question1" />
                <ErrorMessage name="question1" component="div" className="error" />
            </div>

            <div>
                <label htmlFor="question2">Question 2:</label>
                <Field type="text" name="question2" />
                <ErrorMessage name="question2" component="div" className="error" />
            </div>

            <button type="button" onClick={prevStep}>
                Previous
            </button>
        </div>
    );
};

export default Step2;
